import React from "react";
import adminApi from "../services/adminApi";

export default function Navbar({ adminName, onLogout }) {
  return (
    <nav className="bg-gradient-to-r from-slate-800 to-slate-900 shadow-lg border-b border-slate-700">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Left side - Admin info */}
          <div className="flex items-center space-x-4">
            <div className="flex-shrink-0">
              <div className="w-10 h-10 bg-gradient-to-r from-blue-500 to-purple-600 rounded-full flex items-center justify-center">

              </div>
            </div>
            <div>
              <h1 className="text-xl font-bold text-white">
                {adminName || "Admin Dashboard"}
              </h1>
              <p className="text-sm text-slate-300">Form Management System</p>
            </div>
          </div>

          {/* Right side - Navigation items */}
          <div className="flex items-center space-x-4">
            {/* Status indicator */}
            <div className="flex items-center space-x-2">
              <div className="w-2 h-2 bg-green-400 rounded-full animate-pulse"></div>
              <span className="text-sm text-slate-300">Online</span>
            </div>

            {/* Notification bell (optional) */}
            <button className="p-2 rounded-lg text-slate-400 hover:text-white hover:bg-slate-700 transition-colors duration-200">

            </button>

            {/* Logout button */}
            <button 
              onClick={onLogout}
              className="group inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-lg text-white bg-gradient-to-r from-red-500 to-red-600 hover:from-red-600 hover:to-red-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-red-500 focus:ring-offset-slate-800 transition-all duration-200 transform hover:scale-105 shadow-lg"
            >

              Logout
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
}
